import {headerContentData} from "../actions/headerAC";
import {connect} from "react-redux";
import Header from "../components/header";

const mapStateToProps = state => ({
    header: state.header.header && Object.keys(state.header.header).find(item => state.header.header[item].system_name === 'header')
});

const mapDispatchToProps = dispatch => ({
    fetchData: url => dispatch(headerContentData(url))
});


export default connect(mapStateToProps, mapDispatchToProps)(Header)
